import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{props.id}</p>
            <p>{props.question}</p>       
        </Paper>
    )
}

export default Question;
